--
-- Name: getalldomain(character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION getalldomain(nome character varying) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
    r domain%rowtype;
    cursor_domain CURSOR FOR SELECT * FROM domain WHERE  domain.gene_systematic_id = nome;
    resultado text;
BEGIN
    resultado = '';
    OPEN cursor_domain;
    LOOP
	FETCH cursor_domain INTO r;
	IF FOUND THEN
		IF r.orientation = '-' THEN
			resultado = resultado || 
			'FT   misc_feature    complement(' || r.pos_begin || '..' || r.pos_end || ');' ||
			'FT                   /domain="' || r.name || '";' ||
			'FT                   /id="' || r.gene_systematic_id ||'";' ||
			'FT                   /label=' || r.label || ';' ||
			'FT                   /note="' || r.note || '";' ||
			'FT                   /colour=13;';
		ELSE
			resultado = resultado || 
			'FT   misc_feature    ' || r.pos_begin || '..' || r.pos_end || ';' ||
			'FT                   /domain="' || r.name || '";' ||
			'FT                   /id="' || r.gene_systematic_id ||'";' ||
			'FT                   /label=' || r.label || ';' ||
			'FT                   /note="' || r.note || '";' ||
			'FT                   /colour=13;';
		END IF; 
	ELSE
		EXIT;
	END IF;
    END LOOP;
    CLOSE cursor_domain;
    RETURN resultado;
END
$$;


ALTER FUNCTION public.getalldomain(nome character varying) OWNER TO postgres;

--
-- Name: getmultipos(character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION getmultipos(nome character varying) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
    inicio integer;
    fim integer;
    cursor_multipos CURSOR FOR  SELECT pos_begin, pos_end FROM MULTIPOS where 	gene_systematic_id = nome;
    cursor_pos CURSOR FOR  SELECT pos_begin, pos_end FROM GENE where systematic_id = nome;
    resultado text;
BEGIN
    resultado = '';
    OPEN cursor_multipos;
    LOOP
	FETCH cursor_multipos INTO inicio, fim;
	IF FOUND THEN 
		IF resultado <> '' THEN 
			resultado = resultado || ',';
		END IF;
		resultado = resultado || inicio || '..' || fim ;
	END IF;
	IF not FOUND THEN EXIT;
	END IF;
    END LOOP;
    CLOSE cursor_multipos;
    IF resultado = '' THEN
	OPEN cursor_pos;
	  FETCH cursor_pos INTO inicio, fim;
	  resultado = resultado || inicio || '..' || fim ;
	CLOSE cursor_pos;
    END IF;
    RETURN resultado;
END
$$;


ALTER FUNCTION public.getmultipos(nome character varying) OWNER TO postgres;

--
-- Name: getoptu(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION getoptu(pos_begin integer, pos_end integer) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
    r fgenes%rowtype;
    cursor_fgenes CURSOR FOR SELECT * FROM fgenes WHERE  fgenes.inicio = pos_begin or fgenes.fim = pos_end;
    resultado text;
    qtecds integer; 
BEGIN
    resultado = 'nf';
    OPEN cursor_fgenes;
	FETCH cursor_fgenes INTO r;
	IF FOUND THEN
		resultado = r."Tipo";
		IF r."Tipo" = 'Op' THEN
			SELECT INTO qtecds max(entidade_ordem) from fgenes where fgenes.entidade = r.entidade;
			resultado = resultado || ' (' || r.entidade_ordem || ' from ' || qtecds || ')' ;
		END IF;
	END IF;
    CLOSE cursor_fgenes;
    RETURN resultado;
END
$$;


ALTER FUNCTION public.getoptu(pos_begin integer, pos_end integer) OWNER TO postgres;

--
-- Name: getsignal(character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION getsignal(nome character varying) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
    cursor_signal CURSOR FOR SELECT gene.systematic_id, gene.pos_begin, gene.pos_end, gene.orientation, signal.pos_clevage
							 FROM gene, signal WHERE  signal.gene_systematic_id=gene.systematic_id and signal.gene_systematic_id = nome;
	systematic_id text;
	pos_begin integer;
	pos_end integer;
	pos_clevage integer;
	orientation char;
    resultado text;
BEGIN
    resultado = '';
    OPEN cursor_signal;
    LOOP
	FETCH cursor_signal INTO systematic_id, pos_begin, pos_end, orientation, pos_clevage;
	IF FOUND THEN
		IF orientation = '-' THEN
			resultado = resultado || 
	'FT   misc_feature    complement(' || to_char( (pos_end-(3*int4(pos_clevage))),'9999999') || '..' || pos_end || ');' ||
	'FT                   /coord="' || pos_clevage || ',' || to_char( (int4(pos_clevage)+1),'999') || '";' ||
	'FT                   /domain="SIGNAL PEPTIDE";' ||
	'FT                   /id="' || systematic_id ||'";' ||
	'FT                   /label=Predicted by SignalPHMM under Surfg;' ||
	'FT                   /note="Possible secreted protein";' ||
	'FT                   /colour=2;';
		ELSE
			resultado = resultado || 
	'FT   misc_feature    ' || pos_begin || '..' || to_char( (pos_begin+(3*int4(pos_clevage))),'9999999') || ';' ||
	'FT                   /coord="' || pos_clevage || ',' || to_char( (int4(pos_clevage)+1),'999') || '";' ||
	'FT                   /domain="SIGNAL PEPTIDE";' ||
	'FT                   /id="' || systematic_id ||'";' ||
	'FT                   /label=Predicted by SignalPHMM under Surfg;' ||
	'FT                   /note="Possible secreted protein";' ||
	'FT                   /colour=2;';
		END IF; 
	ELSE
		EXIT;
	END IF;
    END LOOP;
    CLOSE cursor_signal;
    RETURN resultado;
END
$$;


